import { Link } from "react-router-dom";

const Home=()=> {
   return (
    <div>
      <Link to="/findRestaurants" style={{ textDecoration: "none", color: "black" }}>
         <div>Find Restaurant</div>
      </Link>
      <Link to="/studentsPicks" style={{ textDecoration: "none", color: "black" }}>
         <div>Student Picks</div>
      </Link>
    </div>
   )
}
export default Home;
